import React from "react";
import NavBarHome from "./navbar-home";
import Slider from "./slider";
import {Button, Col, Row} from "react-bootstrap";
import leo from "./../image/leo.png"
import '../scss/home.css'


export default class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            }
        this.bind();
        };
    bind() {
        this.redirectFromWhats = this.redirectFromWhats.bind(this);
    }

    redirectFromWhats(){
        return window.open("https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0")
    }

    render() {
        return (
        <>
            <h1 style={{textAlign: 'center', marginTop: '30px'}}>Dr Leonardo Simões</h1>
            <Button style={{display: "block"}} className='position-absolute end-0'></Button>
            <NavBarHome/>
            <Slider/>
            <h2 style={{textAlign: 'center', marginTop:"40px", marginBottom:"30px"}}>Quem sou eu?</h2>
            <Row style={{backgroundColor: 'green'}}>
                <Col>
                    <img src={leo} className="leo-img"></img>
                </Col>
                <Col>
                    <div>
                        Dr Leonardo Simões
                    </div>
                </Col>
            </Row>
        </>
        )
    }
}
